$(() => {
  let video = $("video")[0]
  let over = video.parentNode.parentNode
  var socket = io.connect("https://xnotif.herokuapp.com/");

  //websocketで接続した時
  socket.on('push', function(message) {
  let mp = $("<audio/>", {
    src: "data:audio/mp3;base64,"
  })[0]

    let img = $("<img/>", {
      src: "data:image/png;base64,",
      style: "width: 150px; height: 100px; position: absolute; right: 0px; bottom: 0px; z-index: 10; opacity: 1.0",
    })
    $(over).append(img)
    $(img).animate({
      opacity:0.0
    }, 3000)

    mp.currentTime = 0
    mp.play()
  });
})
